import React from 'react'
import "/Users/jenishmanandhar/djangoapi/my-app/src/Home.css"
import { NavLink, Link } from 'react-router-dom'; 

const Home = () => {
  return (
    <>
      <div className="navbarContaner">
        <div className="navbarElement">
            <div className="navbarLogo">
                <span className="logotext">myProperty..</span>
            </div>
            <div className="nabarItem">
                <ul className="navbarList">
                    <li className="Link home navbartext"><NavLink to='/' className='Links'>Home</NavLink></li>
                    {/* <li className="Link home navbartext"><NavLink to='/products' className='Links'>Property</NavLink></li> */}
                    <li className="Link home navbartext"><NavLink to='/products' className='Links'>Services</NavLink></li>
                    <li className="Link home navbartext"><NavLink to='/about' className='Links'>Contact</NavLink></li>


                   {admin? <li className="Link home navbartext"><Link to='/addhome' className='Links'>➕Home</Link></li>:""} 
                   {admin? <li className="Link home navbartext"><Link to='/addproduct' className='Links'>➕Property</Link></li>:""} 
                   {userData || admin? null:<li className="regis home navbartext"><Link to='/login' className='Links'>Login</Link></li>} 
                   {userData || admin? null:<li className="regis home navbartext"><Link to='/register' className='Links'>Register</Link></li>} 

                </ul>
            </div>

            <div className="portoalUsername">
               {userData? <span className="userPortail">{userData.user.name}</span>:""} 
               {admin? <span className="userPortail">{admin.name}</span>:""} 
            </div>
            <div className="nsvCartItems-0">
      </div>
               {userData || admin? <li className=" "><span onClick={logoutHandle} className='logout'>Logout 📤</span></li> :null} 
        </div>

      </div>

    </>
  )
}

export default Home
